const axios = require('axios')



export const getCoffeeShopLocations = (setCoffeeShops, userLocation) => {
    const userLocationString = ``
    console.log(userLocation)
    axios.get(`/locations/${userLocation}`)
        .then((res) => {
            setCoffeeShops(res.data)
        })
}
